import React, { useState } from 'react';
import './App.css';
import AuthForm from './AuthForm';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <div className="App">
      <header className="App-header">
        {isLoggedIn ? (
          <div className="sidebar">
            <h2>课程管理</h2>
            <ul>
              <li>课程互动</li>
              <li>小组讨论</li>
              <li>学习评价</li>
            </ul>
          </div>
        ) : (
          <AuthForm onLogin={handleLogin} />
        )}
      </header>
    </div>
  );
}

export default App;
